INSERT INTO "MaxCapacity" VALUES ('NB',2025,'E_WIND-ON-1',0.625,'GW','The NB Power IRP does not provide resource limits. The NS IRP [E4] follows a similar approach and limits each of its five wind regions to 500 MW a piece, totalling a limit of 5.5 GW of new wind. The ACES model includes four regions and caps them at 625 MW a piece, for a total of 2.5 GW of new wind. This limit of 625 MW of new wind per wind region is applied to every province.');
