INSERT INTO "MaxCapacity" VALUES ('NS',2025,'E_WIND-OFF',5.1,'GW','From [E27]: “Based on existing data, the only region that is 584 likely to be suitable for a large-scale OWF employing monopiles is Sable Island Bank (Figure 8). The area of the bank above 30m water depth is ~1700 km2 (a number that excludes the subareal portion – Sable Island): a potential for 5.1 GW of OWF capacity if all the area is utilized and 3.0 MW per km2  spacing is used (Musail et al. 2016).”');
