INSERT INTO `CostVariable` VALUES ('NS', 2020, 'H2_SMR-CCS',          2020, 2.5,           '$M/PJ', '[E7]', 'Document states that NG (at $12.63/GJ) accounts for 87-89% of variable costs. Assuming 88%, process variable cost is calculated by (12.63 [$/GJ_NG] / 0.88 / 0.69 = 20.8 where 0.69 is the process efficiency). This is the total variable cost. The cost of NG is already taken into account by the import technology, so variable cost of this process is 0.12*20.8 = 2.5 Does not give the currency year. Assumption is for a plant producing 100 tonnes of H2/day. Current costs only. Assumption: no price declines. ');
